void fwht::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst\" :  \"" << ap_rst.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ap_start\" :  \"" << ap_start.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"ap_done\" :  \"" << ap_done.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_idle\" :  \"" << ap_idle.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_ready\" :  \"" << ap_ready.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"block_r_address0\" :  \"" << block_r_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"block_r_ce0\" :  \"" << block_r_ce0.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"block_r_q0\" :  \"" << block_r_q0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"block_r_address1\" :  \"" << block_r_address1.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"block_r_ce1\" :  \"" << block_r_ce1.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"block_r_q1\" :  \"" << block_r_q1.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"output_block_address0\" :  \"" << output_block_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"output_block_ce0\" :  \"" << output_block_ce0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"output_block_we0\" :  \"" << output_block_we0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"output_block_d0\" :  \"" << output_block_d0.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"output_block_q0\" :  \"" << output_block_q0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"output_block_address1\" :  \"" << output_block_address1.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"output_block_ce1\" :  \"" << output_block_ce1.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"output_block_we1\" :  \"" << output_block_we1.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"output_block_d1\" :  \"" << output_block_d1.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"output_block_q1\" :  \"" << output_block_q1.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"stride\" :  \"" << stride.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"input_step\" :  \"" << input_step.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"intra\" :  \"" << intra.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

